import React, {useState} from 'react'

//MUI Stuff
import AppBar from '@material-ui/core/AppBar'
import Toolbar from '@material-ui/core/Toolbar'
import Button from '@material-ui/core/Button'
import { Link } from 'react-router-dom'

function Navbar(){

const [toggle, setToggle]= useState(true)

const handleToggle=()=>{

    setToggle(false)

}

return (
    <AppBar className='nav-container'>
        <Toolbar>
            <Button color="inherit"  component={Link} to='/' >Home</Button>
            {toggle}?
            <Button color="inherit" onClick={handleToggle} to='/login'>Login</Button>
            :
            <Button color="inherit" onClick={handleToggle} to='/signup'>Signup</Button>
        </Toolbar>
        <h1 className="headerText" >Urban Harvest</h1>
        <h2 className="no-waste">No waste is good waste.</h2>
    </AppBar>
)


}

export default Navbar
